import React from "react";

const Player = () => {
    <div className="Player">
        <button className="play-button" text="PLAY"></button>
        <button className="follow-button" text="FOLLOW"></button>

        <span className="nav-link-overview">Home</span>
        <span className="nav-link-about">Browse</span>
        <span className="nav-link-concerts">Radio</span>

    </div>
};

export default Player;
